import React from "react";
import { Grid } from "@material-ui/core";

export default function Button() {
  return (
    <>
      <Grid container>
        <Grid item>
          <a href="google.com">
            <span>see more</span>
            <span>on github</span>
          </a>
        </Grid>
      </Grid>
    </>
  );
}
